  false,\n\t\"url\": null,\n\t\"notes\": \"The black tern is a colonial nesting marsh
  bird which has been declining significantly in numbers throughout its range, and
  in particular in the Northeast. In Vermont the population has declined approximately
  50% since the 1970's. This report outlines and discusses census results for the
  past few years (1990-1992) and offers perspectives on future research and management
  options.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
